post1 = Post.create!(
  title: 'DIY Solar Bottle Lamp',
  description: "Solar Bottle Lamp is a solar-powered light that is constructed from waste plastic bottles. The design idea is to reuse waste plastic bottles by attaching a 3D printed solar lamp in place of their old plastic cap. It can be fitted into almost all soft drinks bottles.
  Recycling obviously helps make plastics more sustainable but sometimes, recycling can be less carbon-friendly than we would like for it to be so instead of recycling, why don’t we try upcycling! Upcycling is the process of reusing items in a way they were not necessarily intended for that gives them a new life rather than going into the trash or being sent off to be recycled.
  Solar Bottle Lamp can be used to provide lighting in rural areas. These lights are surprisingly bright, illuminating your campsite, backyard, pathways, or even your home in the case of a power outage.",
  thumbnailImg: "data:image/png;base64,",
  isFlagged: false,
  user: user1,
  category: c1
)

post2 = Post.create!(
  title: '100 LED Oscilloscope',
  description: "his is my next build using LED matrix's. You may have seen my last one - 81 LED Chaser, well this project uses 100 LED's and is an oscilloscope!
  Admittedly, the resolution isn't great for checking measurements (it is only 100 pixels!). However, it is fantastic at visualizing audio waveforms via a mic.
  There are 4 IC's that make up the project. First there are the 4017 decade counter and a LM3914 LED driver which control the LED's. Next is a 555 timer for clock input and lastly a 386 op amp to increase the signal.
  If you want more technical detail of how it all works, then check out this link",
  thumbnailImg: "data:image/png;base64,",
  isFlagged: false,
  user: user1,
  category: c1
)

post3 = Post.create!(
  title: 'Magic Wand That Turns Into Pen',
  description: "I think like a lot of people once you get exposed to Harry Potter can't wait to get a wand. Last year our family went to Universal Studios Orlando and visited Ollivander's Wand shop and both my kids got to pick a wand. It was a great day, and they were super excited waving the wand around casting spells and pretending to battle one another. However, I noticed that once we returned home the wands went up on a shelf and they hardly touched them. I was hopeful they would play with them a bit more but alas they sat on the shelf gathering dust.
    One day while making a pen on my lathe I thought it might be a neat idea to combine the pen and the wand. Naturally I searched online for \"wand pen\" and found a few results but the majority were plastic, and most were made so that the pen tip just stuck out of the tip of the wand or the bottom of the handle. It was obvious they were wands, this sort of ruins the illusion of the wand. There were some that were nicer plastic versions, but they were not full-sized wands. The bottom line is they all kind of looked cheap and fake. So, I decided to try and make a pen wand/wand pen, out of wood, that concealed the pen in the handle section of the wand and still looked like a wand. The following Instructable describes my process.",
  thumbnailImg: "data:image/png;base64,",
  isFlagged: false,
  user: user2,
  category: c3
)

post4 = Post.create!(
  title: 'Bluetooth 5 Hard Drive Audio Player',
  description: " have looked at many Instructables in the last few years and often thought about writing one myself but having the time is always a problem. However, when I spotted the “Trash to Treasure” contest it occurred to me that my recently completed project just may be an appropriate entry, and so prompted me to produce this Instructable.
  This is my very first Instructable and is perhaps more of a “what you can build from pre-used and scrap parts” type of Instructable than a fully detailed “how to make it” Instructable, if that makes any sense!
